import React, { useState } from "react";
import {
  Star,
  Calendar,
  User,
  Target,
  Clock,
  Moon,
  Sun,
  Compass,
} from "lucide-react";

const Home = () => {
  const [formData, setFormData] = useState({
    name: "",
    day: "",
    month: "",
    year: ""
  });
  const [activeSection, setActiveSection] = useState("all");
  const [isAuthenticated, setIsAuthenticated] = useState(true); // Simulated auth state

  const onInputChange = (field, value) => {
    setFormData(prev => ({ ...prev, [field]: value }));
  };

  const handleSubmit = async () => {
    if (!isAuthenticated) {
      alert("Please sign up first!");
      return;
    }

    if (!formData.name || !formData.day || !formData.month || !formData.year) {
      alert("❌ Please fill in all fields");
      return;
    }

    const month = String(formData.month).padStart(2, "0");
    const day = String(formData.day).padStart(2, "0");
    const dob = `${formData.year}-${month}-${day}`;

    const payload = {
      full_name: formData.name,
      dob: dob,
    };

    try {
      // Simulate API call since axios isn't available
      console.log("Submitting payload:", payload);

      // Simulate successful response
      setTimeout(() => {
        alert("✅ Numerology calculation completed! Your profile has been generated.");
      }, 500);

    } catch (error) {
      console.error("Error:", error);
      alert("❌ Something went wrong");
    }
  };

  const getLifePathDescription = (number) => {
    const descriptions = {
      1: "The Leader - Independent, pioneering, ambitious",
      2: "The Diplomat - Cooperative, sensitive, peacemaker",
      3: "The Creative - Artistic, expressive, optimistic",
      4: "The Builder - Practical, disciplined, hardworking",
      5: "The Adventurer - Freedom-loving, curious, dynamic",
      6: "The Nurturer - Caring, responsible, family-oriented",
      7: "The Seeker - Spiritual, analytical, introspective",
      8: "The Achiever - Ambitious, material success, authority",
      9: "The Humanitarian - Compassionate, generous, wise",
    };
    return descriptions[number] || "Unknown";
  };

  const getBirthNumberDescription = (number) => {
    const descriptions = {
      1: "Natural leader with strong willpower",
      2: "Diplomatic and cooperative nature",
      3: "Creative and expressive personality",
      4: "Practical and methodical approach",
      5: "Adventurous and freedom-seeking",
      6: "Nurturing and responsibility-focused",
      7: "Analytical and spiritually inclined",
      8: "Ambitious with business acumen",
      9: "Humanitarian with global perspective",
    };
    return descriptions[number] || "Unique traits";
  };

  const getDestinyNumberDescription = (number) => {
    const descriptions = {
      1: "Leadership and innovation destiny",
      2: "Partnership and harmony purpose",
      3: "Creative expression and inspiration",
      4: "Building and systematic achievement",
      5: "Freedom and progressive change",
      6: "Service and nurturing others",
      7: "Spiritual wisdom and research",
      8: "Material mastery and authority",
      9: "Universal service and completion",
    };
    return descriptions[number] || "Special mission";
  };

  // Form Components
  const FormInput = ({
    label,
    type = "text",
    placeholder,
    value,
    onChange,
    ...props
  }) => (
    <div>
      <label className="block text-white font-medium mb-2">
        {label}
      </label>
      <input
        type={type}
        placeholder={placeholder}
        value={value}
        onChange={onChange}
        className="w-full px-4 py-3 bg-white bg-opacity-10 border border-white border-opacity-20 rounded-lg text-white placeholder-white placeholder-opacity-60 focus:border-purple-400 focus:ring-2 focus:ring-purple-400 focus:ring-opacity-20 transition-all"
        {...props}
      />
    </div>
  );

  const FormSelect = ({ label, value, onChange, options, placeholder }) => (
    <div>
      <label className="block text-white font-medium mb-2">
        {label}
      </label>
      <select 
        value={value} 
        onChange={onChange} 
        className="w-full px-4 py-3 bg-white bg-opacity-10 border border-white border-opacity-20 rounded-lg text-white focus:border-purple-400 focus:ring-2 focus:ring-purple-400 focus:ring-opacity-20 transition-all"
      >
        <option value="" style={{backgroundColor: '#1f2937'}}>{placeholder}</option>
        {options.map((option, index) => (
          <option key={option} value={index + 1} style={{backgroundColor: '#1f2937'}}>
            {option}
          </option>
        ))}
      </select>
    </div>
  );

  // Compact Form Component for Top Position
  const CompactFormSection = ({ formData, onInputChange, onSubmit }) => {
    const months = [
      "January", "February", "March", "April", "May", "June",
      "July", "August", "September", "October", "November", "December",
    ];

    const isFormValid = formData.name && formData.day && formData.month && formData.year;

    return (
      <div className="bg-white bg-opacity-5 backdrop-blur-lg border border-white border-opacity-20 rounded-2xl p-6 shadow-2xl mb-8 hover:bg-white hover:bg-opacity-10 transition-all duration-300">
        <div className="text-center mb-6">
          <div className="w-16 h-16 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full flex items-center justify-center mx-auto mb-4">
            <Calendar className="w-8 h-8 text-white" />
          </div>
          <h2 className="text-2xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-400 mb-2">
            🔮 Get Your Complete Numerology Report
          </h2>
          <p className="text-white text-opacity-80">
            Quick calculation - Enter your details below
          </p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4 mb-6">
          <FormSelect
            label="Month"
            value={formData.month}
            onChange={(e) => onInputChange("month", e.target.value)}
            options={months}
            placeholder="Select Month"
          />
          <FormInput
            label="Day"
            type="number"
            min="1"
            max="31"
            placeholder="DD"
            value={formData.day}
            onChange={(e) => onInputChange("day", e.target.value)}
          />
          <FormInput
            label="Year"
            type="number"
            min="1900"
            max="2024"
            placeholder="YYYY"
            value={formData.year}
            onChange={(e) => onInputChange("year", e.target.value)}
          />
          <FormInput
            label="Full Name"
            type="text"
            placeholder="Birth name"
            value={formData.name}
            onChange={(e) => onInputChange("name", e.target.value)}
          />
        </div>

        <button 
          onClick={onSubmit}
          disabled={!isFormValid}
          className="w-full py-4 px-8 bg-gradient-to-r from-purple-600 to-pink-600 text-white font-semibold rounded-lg hover:from-purple-700 hover:to-pink-700 disabled:opacity-50 disabled:cursor-not-allowed transition-all duration-300 shadow-lg"
        >
          ✨ Calculate My Numerology Profile
        </button>
      </div>
    );
  };

  // Main Information Sections
  const WhatIsNumerologySection = () => (
    <div className="bg-white bg-opacity-5 backdrop-blur-lg border border-white border-opacity-20 rounded-2xl p-8 shadow-2xl hover:bg-white hover:bg-opacity-10 transition-all duration-300">
      <div className="text-center mb-6">
        <div className="w-16 h-16 bg-gradient-to-r from-blue-500 to-cyan-500 rounded-full flex items-center justify-center mx-auto mb-4">
          <Compass className="w-8 h-8 text-white" />
        </div>
        <h2 className="text-3xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-blue-400 to-cyan-400 mb-4">
          What is Numerology?
        </h2>
      </div>

      <div className="space-y-6 text-white text-opacity-90" style={{lineHeight: '1.7'}}>
        <p>
          <strong className="text-cyan-400">Numerology</strong> is an ancient metaphysical science that explores the mystical relationship between numbers and life events. It's based on the belief that numbers carry vibrational energy that influences our personality, relationships, and life path.
        </p>
        <p>
          Dating back over 4,000 years to ancient civilizations like Babylon, Egypt, and Greece, numerology was developed by great minds including <strong className="text-purple-400">Pythagoras</strong>, who believed "numbers rule the universe."
        </p>
        <div className="bg-gradient-to-r from-purple-500 from-opacity-20 to-pink-500 to-opacity-20 border border-purple-400 border-opacity-30 rounded-lg p-4">
          <p className="font-semibold text-white">
            🔮 Core Principle: Every number from 1-9 carries unique vibrational frequencies that shape our destiny and reveal hidden truths about our life purpose.
          </p>
        </div>
      </div>
    </div>
  );

  const WhyNumerologyImportantSection = () => (
    <div className="bg-white bg-opacity-5 backdrop-blur-lg border border-white border-opacity-20 rounded-2xl p-8 shadow-2xl hover:bg-white hover:bg-opacity-10 transition-all duration-300">
      <div className="text-center mb-6">
        <div className="w-16 h-16 bg-gradient-to-r from-orange-500 to-red-500 rounded-full flex items-center justify-center mx-auto mb-4">
          <Target className="w-8 h-8 text-white" />
        </div>
        <h2 className="text-3xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-orange-400 to-red-400 mb-4">
          Why is Numerology Important?
        </h2>
      </div>

      <div className="space-y-6 text-white text-opacity-90" style={{lineHeight: '1.7'}}>
        <p>
          Numerology serves as a powerful tool for <strong className="text-orange-400">self-discovery and guidance</strong>, helping you understand your true nature and life's direction.
        </p>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-6">
          <div className="bg-gradient-to-r from-orange-500 from-opacity-20 to-red-500 to-opacity-20 border border-orange-400 border-opacity-30 rounded-lg p-4">
            <h4 className="text-orange-400 font-semibold mb-2">🎯 Self-Understanding</h4>
            <p>Reveals your strengths, weaknesses, and natural talents</p>
          </div>
          <div className="bg-gradient-to-r from-green-500 from-opacity-20 to-emerald-500 to-opacity-20 border border-green-400 border-opacity-30 rounded-lg p-4">
            <h4 className="text-green-400 font-semibold mb-2">💼 Career Guidance</h4>
            <p>Shows ideal career paths aligned with your vibration</p>
          </div>
          <div className="bg-gradient-to-r from-pink-500 from-opacity-20 to-rose-500 to-opacity-20 border border-pink-400 border-opacity-30 rounded-lg p-4">
            <h4 className="text-pink-400 font-semibold mb-2">💕 Relationship Compatibility</h4>
            <p>Understanding compatibility with partners and friends</p>
          </div>
          <div className="bg-gradient-to-r from-indigo-500 from-opacity-20 to-purple-500 to-opacity-20 border border-indigo-400 border-opacity-30 rounded-lg p-4">
            <h4 className="text-indigo-400 font-semibold mb-2">⏰ Timing Decisions</h4>
            <p>Optimal timing for major life decisions and changes</p>
          </div>
        </div>
      </div>
    </div>
  );

  const LifePathSection = () => (
    <div className="bg-white bg-opacity-5 backdrop-blur-lg border border-white border-opacity-20 rounded-2xl p-8 shadow-2xl hover:bg-white hover:bg-opacity-10 transition-all duration-300">
      <div className="text-center mb-6">
        <div className="w-16 h-16 bg-gradient-to-r from-yellow-500 to-orange-500 rounded-full flex items-center justify-center mx-auto mb-4">
          <Star className="w-8 h-8 text-white" />
        </div>
        <h2 className="text-3xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-yellow-400 to-orange-400 mb-4">
          What's a Life Path Number?
        </h2>
      </div>

      <div className="space-y-6 text-white text-opacity-90" style={{lineHeight: '1.6'}}>
        <p>
          Your <strong className="text-yellow-400">Life Path Number</strong> is the most important number in numerology. It represents your life's journey, core purpose, and the lessons you're here to learn.
        </p>
        <p>
          Calculated from your <strong className="text-orange-400">birth date</strong>, it reveals your natural talents, personality traits, and the challenges you'll face throughout your lifetime.
        </p>
        <div className="bg-gradient-to-r from-yellow-500 from-opacity-20 to-orange-500 to-opacity-20 border border-yellow-400 border-opacity-30 rounded-lg p-4">
          <p className="font-semibold text-white">
            ✨ Think of it as your soul's blueprint - the path you chose before incarnating into this lifetime.
          </p>
        </div>
      </div>

      <div className="mt-8">
        <h3 className="text-orange-400 font-bold mb-4 text-xl">Life Path Characteristics:</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-3">
          {Array.from({ length: 9 }, (_, i) => i + 1).map((num) => (
            <div key={num} className="bg-white bg-opacity-10 border border-white border-opacity-20 rounded-lg p-3 hover:bg-white hover:bg-opacity-20 transition-all">
              <span className="font-bold text-yellow-400">Path {num}:</span>
              <span className="ml-2 text-sm text-white text-opacity-80">
                {getLifePathDescription(num).split(" - ")[1]}
              </span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );

  const BirthNumberSection = () => (
    <div className="bg-white bg-opacity-5 backdrop-blur-lg border border-white border-opacity-20 rounded-2xl p-8 shadow-2xl hover:bg-white hover:bg-opacity-10 transition-all duration-300">
      <div className="text-center mb-6">
        <div className="w-16 h-16 bg-gradient-to-r from-green-500 to-teal-500 rounded-full flex items-center justify-center mx-auto mb-4">
          <Calendar className="w-8 h-8 text-white" />
        </div>
        <h2 className="text-3xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-green-400 to-teal-400 mb-4">
          What is Birth Number?
        </h2>
      </div>

      <div className="space-y-6 text-white text-opacity-90" style={{lineHeight: '1.7'}}>
        <p>
          Your <strong className="text-green-400">Birth Number</strong> is derived from the day of the month you were born. It represents your <strong className="text-teal-400">natural personality</strong> and how you appear to others.
        </p>
        <p>
          Unlike Life Path, which shows your life journey, Birth Number reveals your <strong className="text-green-400">innate characteristics</strong> and immediate behavioral patterns.
        </p>

        <div className="bg-gradient-to-r from-green-500 from-opacity-20 to-teal-500 to-opacity-20 border border-green-400 border-opacity-30 rounded-lg p-4">
          <p className="font-semibold text-white">
            🎭 Your Birth Number is like your "personality mask" - the first impression you give to the world.
          </p>
        </div>

        <div className="mt-8">
          <h3 className="text-green-400 font-bold mb-4 text-xl">Birth Number Traits:</h3>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-3">
            {Array.from({ length: 9 }, (_, i) => i + 1).map((num) => (
              <div key={num} className="bg-white bg-opacity-10 border border-white border-opacity-20 rounded-lg p-3 hover:bg-white hover:bg-opacity-20 transition-all">
                <span className="font-bold text-green-400">Birth {num}:</span>
                <span className="ml-2 text-sm text-white text-opacity-80">
                  {getBirthNumberDescription(num)}
                </span>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );

  const DestinyNumberSection = () => (
    <div className="bg-white bg-opacity-5 backdrop-blur-lg border border-white border-opacity-20 rounded-2xl p-8 shadow-2xl hover:bg-white hover:bg-opacity-10 transition-all duration-300">
      <div className="text-center mb-6">
        <div className="w-16 h-16 bg-gradient-to-r from-indigo-500 to-purple-500 rounded-full flex items-center justify-center mx-auto mb-4">
          <User className="w-8 h-8 text-white" />
        </div>
        <h2 className="text-3xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-indigo-400 to-purple-400 mb-4">
          What is Destiny Number?
        </h2>
      </div>

      <div className="space-y-6 text-white text-opacity-90" style={{lineHeight: '1.7'}}>
        <p>
          Your <strong className="text-indigo-400">Destiny Number</strong> (also called Expression Number) is calculated from the <strong className="text-purple-400">full name given at birth</strong>. It represents your life's mission and ultimate potential.
        </p>
        <p>
          While Life Path shows the journey, Destiny Number reveals the <strong className="text-indigo-400">destination</strong> - what you're meant to achieve and contribute to the world.
        </p>

        <div className="bg-gradient-to-r from-indigo-500 from-opacity-20 to-purple-500 to-opacity-20 border border-indigo-400 border-opacity-30 rounded-lg p-4">
          <p className="font-semibold text-white">
            🎯 Your Destiny Number is your soul's calling - the unique gift you're meant to share with humanity.
          </p>
        </div>

        <div className="mt-8">
          <h3 className="text-indigo-400 font-bold mb-4 text-xl">Destiny Number Purposes:</h3>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-3">
            {Array.from({ length: 9 }, (_, i) => i + 1).map((num) => (
              <div key={num} className="bg-white bg-opacity-10 border border-white border-opacity-20 rounded-lg p-3 hover:bg-white hover:bg-opacity-20 transition-all">
                <span className="font-bold text-indigo-400">Destiny {num}:</span>
